FIELD CONTROLS -->\r\n                                <#-- ========================= -->\r\n                                <#if control.kind == \"field\">\r\n\r\n                                    <div class=\"form-field ${control.cssClass!\'\'}\">\r\n                                        <div class=\"form-group\">\r\n\r\n                                            <#if control.label?? && control.label?has_content>\r\n                                                <label>${control.label}</label>\r\n                                            </#if>\r\n\r\n                                            <#-- HTML -->\r\n                                            <#if control.uiType == \"html\">\r\n                                                <div [innerHTML]=\"trustHtml(data.${control.ngModel})\"></div>\r\n                                            </#if>\r\n\r\n                                            <#-- TEXT -->\r\n                                            <#if control.uiType == \"text\">\r\n                                                <input type=\"text\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- TEXTAREA -->\r\n                                            <#if control.uiType == \"textarea\">\r\n                                                <textarea class=\"form-control\"\r\n                                                          <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                          <#if !control.editable>readonly</#if>>\r\n                                                    ${control.value!\'\'}\r\n                                                </textarea>\r\n                                            </#if>\r\n\r\n                                            <#-- INTEGER -->\r\n                                            <#if control.uiType == \"int\">\r\n                                                <input type=\"number\"\r\n                                                       step=\"1\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- DECIMAL -->\r\n                                            <#if control.uiType == \"decimal\">\r\n                                                <input type=\"number\"\r\n                                                       step=\"any\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- DATE -->\r\n                                            <#if control.uiType == \"date\">\r\n                                                <input type=\"date\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- DATETIME -->\r\n                                            <#if control.uiType == \"datetime\">\r\n                                                <input type=\"datetime-local\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- CHECKBOX -->\r\n                                            <#if control.uiType == \"checkbox\">\r\n                                                <input type=\"checkbox\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if control.value?? && control.value == true>checked</#if>\r\n                                                       <#if !control.editable>disabled</#if> />\r\n                                            </#if>\r\n\r\n                                            <#-- SELECT -->\r\n                                            <#if control.uiType == \"select\">\r\n\r\n                                                <#-- parse JSON string  object -->\r\n                                                <#assign options = control.options?eval_json>\r\n\r\n                                                <select class=\"form-control\"\r\n                                                <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                <#if !control.editable>disabled</#if>>\r\n\r\n                                                <#if options?? && options.data??>\r\n                                                    <#list options.data as opt>\r\n                                                    <option value=\"${opt.value!\'\'}\">\r\n                                                        ${opt.display!\'\'}\r\n                                                    </option>\r\n                                                    </#list>\r\n                                                </#if>\r\n\r\n                                                </select>\r\n                                            </#if>\r\n\r\n\r\n                                            <#-- LIST -->\r\n                                            <#if\r\n                                            control.uiType == \"list\" &&\r\n                                            control.options?? &&\r\n                                            control.options?has_content &&\r\n                                            control.options?starts_with(\"{\")>\r\n                                            <#assign listOptions = control.options?eval_json>\r\n                                            <div class=\"selector-input\"\r\n                                                 (click)=\"${control.ngModel?replace(\".\", \"_\")}_element = true\"\r\n                                            <#if listOptions.NAME??>data-target=\"#${listOptions.NAME!\'\'}Modal\" data-toggle=\"modal\"</#if>\r\n                                            >\r\n                                                <i class=\"fa-solid fa-magnifying-glass selector-icon\"></i>\r\n                                                <input\r\n                                                        type=\"text\"\r\n                                                        <#if listOptions.NAME??>value=\"${listOptions.DISPLAY!\'\'}\"</#if>\r\n                                                        readonly\r\n                                                />\r\n                                            </div>\r\n                                            </#if>\r\n                                            <#if control.message?? && control.message?has_content>\r\n                                            <div class=\"category\">${control.message}</div>\r\n                                            </#if>\r\n\r\n                                        </div>\r\n                                    </div>\r\n\r\n                                </#if>\r\n\r\n                                <#-- ========================= -->\r\n                                <#-- BUTTON CONTROL -->\r\n                                <#-- ========================= -->\r\n                                <#if control.kind == \"button\">\r\n                                    <div class=\"form-field ${control.cssClass!\'\'}\">\r\n                                        <button type=\"button\"\r\n                                                class=\"btn ${control.buttonClass!\'\'}\">\r\n                                            <i class=\"fa ${control.icon!\'\'}\"></i>\r\n                                            ${control.label!\'\'}\r\n                                        </button>\r\n                                    </div>\r\n                                </#if>\r\n\r\n                                <#-- ========================= -->\r\n                                <#-- TABLE CONTROL (INTENTIONALLY EMPTY) -->\r\n                                <#-- ========================= -->\r\n                                <#if control.kind == \"table\">\r\n                                    <#-- table rendering will be implemented in future version -->\r\n                                </#if>\r\n\r\n                            </#if>\r\n\r\n                        </#list>\r\n                        </#if>\r\n\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n\r\n    </#list>\r\n    </#if>\r\n\r\n</#list>\r\n</#if>\r\n\r\n</div>\r\n\r\n<#if form?? && form.tabs??>\r\n<#list form.tabs?sort_by(\"order\") as tab>\r\n\r\n    <#if tab?? && tab.areas??>\r\n    <#list tab.areas?sort_by(\"order\") as area>\r\n\r\n        <#if area.controls??>\r\n        <#list area.controls as control>\r\n\r\n            <#assign isListWithJsonOptions =\r\n            control.kind == \"field\"\r\n            && control.uiType == \"list\"\r\n            && control.options??\r\n            && control.options?has_content\r\n            && control.options?starts_with(\"{\")\r\n            >\r\n\r\n            <#if isListWithJsonOptions>\r\n            <#assign listOptions = control.options?eval_json>\r\n\r\n                <#if listOptions.NAME??>\r\n                    <div aria-labelledby=\"ModalLabel\" class=\"modal fade\" id=\"${listOptions.NAME!\'\'}Modal\" role=\"dialog\" aria-hidden=\"true\" style=\"margin: 10px;\">\r\n                        <div class=\"modal-dialog modal-dialog-centered\" style=\"max-width: 100%;margin: 0px;\">\r\n                            <div class=\"modal-content\" style=\"background-color: #ffffffad !important;\">\r\n                                <div class=\"modal-header justify-content-center\" style=\"display: block !important;padding: 10px;\">\r\n                                    <button aria-label=\"Close\" data-dismiss=\"modal\" id=\"buttonClose\" type=\"button\" class=\"close modal-dialog-button\">\r\n                                        <i class=\"fa fa-times\"></i>\r\n                                    </button>\r\n                                    <span class=\"modal-title\">\r\n                              ${listOptions.POPUPTITLE!\'\'}\r\n                              <b>Navigate</b> to Entities &amp; press <i class=\"fa fa-square-plus\"></i> to select.</span>\r\n                                </div>\r\n                                <div class=\"modal-body modal-dialog-body\">\r\n                                    <ng-template [ngIf]=\"${control.ngModel?replace(\".\", \"_\")}_element\">\r\n                                        <app-${listOptions.NAME!\'\'} (returnEmmiter)=\"${control.ngModel?replace(\".\", \"_\")}_field_return($event)\" [params]=\"${control.ngModel?replace(\".\", \"_\")}_field_options\"></app-${listOptions.NAME!\'\'}>\r\n                                    </ng-template>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </#if>\r\n\r\n            </#if>\r\n\r\n        </#list>\r\n        </#if>\r\n\r\n    </#list>\r\n    </#if>\r\n\r\n</#list>\r\n</#if>\n/* Utility class to hide elements */\r\n.hidden {\r\n  display: none;\r\n}\r\n\r\n/* Custom styled checkbox */\r\n.form-group input[type=checkbox] {\r\n  position: absolute;\r\n  right: 0;\r\n  top: 50%;\r\n  width: 22px;\r\n  height: 22px;\r\n  transform: translateY(-50%);\r\n  border: 2px solid #51cbce;\r\n  border-radius: 6px;\r\n  background: #fff;\r\n  transition: all 120ms ease;\r\n}\r\n\r\n/* Clickable selector input container */\r\n.selector-input {\r\n  display: flex;\r\n  align-items: center;\r\n  width: 100%;\r\n  padding: 8px 12px;\r\n  border: 1px solid #51cbce;\r\n  background-color: #fff;\r\n  box-sizing: border-box;\r\n  cursor: pointer;\r\n}\r\n\r\n/* Optional leading icon */\r\n.selector-icon {\r\n  display: flex;\r\n  align-items: center;\r\n  margin-right: 8px;\r\n  font-size: 16px;\r\n  color: #236594;\r\n  flex-shrink: 0;\r\n}\r\n\r\n/* Input inherits click behavior from container */\r\n.selector-input input {\r\n  flex: 1;\r\n  min-width: 0;\r\n  border: none;\r\n  outline: none;\r\n  background: transparent;\r\n  font-size: 14px;\r\n  cursor: pointer;\r\n}\r\n\nimport {\r\n  Component,\r\n  Input,\r\n  OnDestroy,\r\n  OnInit\r\n} from \'@angular/core\';\r\nimport { CommonModule } from \'@angular/common\';\r\nimport {Location} from \'@angular/common\';\r\nimport { FormsModule } from \'@angular/forms\';\r\nimport { ActivatedRoute } from \'@angular/router\';\r\nimport { DomSanitizer, Title } from \'@angular/platform-browser\';\r\nimport {EMPTY, Observable, Subject, takeUntil, tap} from \'rxjs\';\r\nimport { CommandNavigatorService } from \'../../../services/system/command-navigator.service\';\r\nimport { LanguageService } from \'../../../services/system/language.service\';\r\nimport { PageComponent } from \'../../page/page-component\';\r\nimport {dateNowPlus, systemParameter, uuid, mergeWithDefaults} from \'../form-utils\';\r\nimport {SofiaFormService} from \'../../../services/crud/sofia-form.service\';\r\n${form.relImports!\'\'}\r\n\r\n/* ============================================================\r\n   Component\r\n   ============================================================ */\r\n@Component({\r\n  selector: \'app-${form.componentName}-form\',\r\n  standalone: true,\r\n  imports: [CommonModule, FormsModule<#if form.relComponents??>, ${form.relComponents}</#if>],\r\n  templateUrl: \'./${form.componentName}-form.component.html\',\r\n  styleUrl: \'./${form.componentName}-form.component.scss\'\r\n})\r\nexport class ${form.componentClass}FormComponent implements OnInit, OnDestroy {\r\n  private readonly destroy$ = new Subject<void>();\r\n  activeTab = \'${form.activeTab}\';\r\n  mode = \'create\';\r\n  @Input() public params: unknown = null;\r\n  data =${form.data};\r\n\r\n<#compress>\r\n<#if form?? && form.tabs??>\r\n  <#list form.tabs?sort_by(\"order\") as tab>\r\n    <#if tab.areas??>\r\n      <#list tab.areas?sort_by(\"order\") as area>\r\n        <#if area.controls??>\r\n          <#list area.controls as control>\r\n\r\n            <#assign isListWithJsonOptions =\r\n            control.kind == \"field\"\r\n            && control.uiType == \"list\"\r\n            && control.options??\r\n            && control.options?has_content\r\n            && control.options?starts_with(\"{\")\r\n                        />\r\n            <#if isListWithJsonOptions>\r\n              <#assign listOptions = control.options?eval_json />\r\n                    ${control.ngModel?replace(\".\", \"_\")}_element = false;\r\n                    ${control.ngModel?replace(\".\", \"_\")}_field_options = ${control.options!\'\'}\r\n            </#if>\r\n\r\n          </#list>\r\n        </#if>\r\n      </#list>\r\n    </#if>\r\n  </#list>\r\n</#if>\r\n</#compress>\r\n\r\n\r\n  constructor(\r\n    private readonly sofiaFormService: SofiaFormService,\r\n    private readonly commandNavigator: CommandNavigatorService,\r\n    private readonly languageService: LanguageService,\r\n    private readonly route: ActivatedRoute,\r\n    private readonly sanitizer: DomSanitizer,\r\n    private readonly location: Location\r\n  ) {}\r\n\r\n  /* =========================\r\n     Lifecycle\r\n     ========================= */\r\n  ngOnInit(): void {\r\n\r\n    if (this.params) {\r\n      this.tryLoadData();\r\n      return;\r\n    }\r\n\r\n    this.route.queryParams\r\n      .pipe(takeUntil(this.destroy$))\r\n      .subscribe(({ nav }) => {\r\n        if (!this.params) {\r\n          this.params = this.commandNavigator.decodeNavCommand(nav);\r\n          this.tryLoadData();\r\n        }\r\n      });\r\n\r\n  }\r\n\r\n  ngOnDestroy(): void {\r\n    this.destroy$.next();\r\n    this.destroy$.complete();\r\n  }\r\n\r\n  selectTab(tab: string): void {\r\n    this.activeTab = tab;\r\n  }\r\n\r\n  private tryLoadData(): void {\r\n    const id = this.getSelectionId();\r\n    if (id) {\r\n      this.mode = \'update\';\r\n      this.loadData(id);\r\n    }\r\n  }\r\n\r\n  private getSelectionId(): string | null {\r\n    return (this.params as any)?.LOCATE?.[\'SELECTION-ID\'] ?? null;\r\n  }\r\n\r\n  loadData(id: string): void {\r\n     this.sofiaFormService\r\n       .getDataById(\'${form.jsonUrl}\', id)\r\n       .subscribe( response => {\r\n         this.data = mergeWithDefaults(\r\n           this.data,\r\n           response\r\n         );\r\n       });\r\n  }\r\n\r\n  saveAndBack(): void {\r\n    const action$ =\r\n      this.mode === \'create\'\r\n        ? this.create()\r\n        : this.mode === \'update\'\r\n          ? this.update()\r\n          : null;\r\n\r\n    if (!action$) {\r\n      return;\r\n    }\r\n\r\n    action$\r\n      .pipe(takeUntil(this.destroy$))\r\n      .subscribe({\r\n        next: () => this.location.back(),\r\n        error: err => console.error(\'Save failed\', err)\r\n      });\r\n  }\r\n\r\n  create(): Observable<any> {\r\n    return this.sofiaFormService.createData(\'${form.jsonUrl}\', this.data).pipe(\r\n      tap(response => {\r\n        this.data = mergeWithDefaults(this.data, response);\r\n        this.mode = \'update\';\r\n      })\r\n    );\r\n  }\r\n\r\n  update(): Observable<any> {\r\n    const id = this.getSelectionId();\r\n    if (!id) {\r\n      return EMPTY;\r\n    }\r\n\r\n    return this.sofiaFormService.updateData(\'${form.jsonUrl}\', id, this.data).pipe(\r\n      tap(response => {\r\n        this.data = mergeWithDefaults(this.data, response);\r\n      })\r\n    );\r\n  }\r\n\r\n  delete(): void {\r\n    const id = this.getSelectionId();\r\n    if (!id) {\r\n      return;\r\n    }\r\n\r\n    this.sofiaFormService\r\n      .deleteData(\'${form.jsonUrl}\', id)\r\n      .pipe(takeUntil(this.destroy$))\r\n      .subscribe({\r\n        error: err => console.error(\'Delete failed\', err)\r\n      });\r\n  }\r\n\r\n  /* =========================\r\n     Utils\r\n     ========================= */\r\n  trustHtml(value?: string) {\r\n    return this.sanitizer.bypassSecurityTrustHtml(value ?? \'\');\r\n  }\r\n\r\n  private get languageId(): string {\r\n    const user = JSON.parse(localStorage.getItem(\'loggedin_user\') ?? \'{}\');\r\n    return user?.currentLanguage?.id ?? 0;\r\n  }\r\n\r\n<#if form?? && form.tabs??>\r\n  <#list form.tabs?sort_by(\"order\") as tab>\r\n    <#if tab.areas??>\r\n      <#list tab.areas?sort_by(\"order\") as area>\r\n        <#if area.controls??>\r\n          <#list area.controls as control>\r\n\r\n            <#assign isListWithJsonOptions =\r\n            control.kind == \"field\"\r\n            && control.uiType == \"list\"\r\n            && control.options??\r\n            && control.options?has_content\r\n            && control.options?starts_with(\"{\")\r\n                        />\r\n            <#if isListWithJsonOptions>\r\n              <#assign listOptions = control.options?eval_json />\r\n\r\n            ${control.ngModel?replace(\".\", \"_\")}_field_return(returingValue: string) {\r\n                this.data.${control.ngModel} = returingValue;\r\n\r\n            <#if listOptions.REFRESH??>\r\n                 this.sofiaFormService\r\n                   .getDataById(\'${form.jsonUrl}/${listOptions.REFRESH}\', returingValue)\r\n                   .subscribe( response => {\r\n                     this.data.${control.cpeRefreshPath!\'\'} = mergeWithDefaults(\r\n                       this.data.${control.cpeRefreshPath!\'\'},\r\n                       response.${listOptions.REFRESH}_obj\r\n                     );\r\n                   });\r\n                </#if>\r\n\r\n            Array.from(document.getElementsByClassName(\'close\'))\r\n              .forEach(el => (el as HTMLElement).click());\r\n            }\r\n\r\n            </#if>\r\n\r\n          </#list>\r\n        </#if>\r\n      </#list>\r\n    </#if>\r\n  </#list>\r\n</#if>\r\n\r\n\r\n\r\n}\r\n\n\nnativeButtonClickHandler(btnCode) {\n}\n\nnativeTableButtonClickHandler(btnCode, formControlTable, dataLine) {\n}\n\nnativeFormEventsHandler(type, metadata) {\nif((type == \'onFormOpen\') && (typeof this.onFormOpen == \"function\")) this.onFormOpen(metadata);\n}\n\nnativeFieldEventsHandler(entityCode, fieldName, type, event) {\n}\n\nnativeTableFieldEventsHandler(entityCode, fieldName, type, event, formControlTable, dataLine) {\n}\n}', 'Department', '06b87850-40ab-4079-8691-0f3fb7c8db0c', NULL, b'1', b'0');
