ditable(myCallback){this.setFieldEditableRef = myCallback;}\nsetFieldEditable(fieldCode, editable){return this.setFieldEditableRef(fieldCode, editable, this.formRef);}\ndefineGetFromBackend(myCallback){this.getFromBackendRef = myCallback;}\ngetFromBackend(url, callback){return this.getFromBackendRef(url, callback);}\ndefineGetFromUrl(myCallback){this.getFromUrlRef = myCallback;}\ngetFromUrl(url, callback){return this.getFromUrlRef(url, callback);}\ndefinePostToBackend(myCallback){this.postToBackendRef = myCallback;}\npostToBackend(url, data, callback){return this.postToBackendRef(url, data, callback);}\ndefinePostToUrl(myCallback){this.postToUrlRef = myCallback;}\npostToUrl(url, data, callback){return this.postToUrlRef(url, data, callback);}\ndefinePutToBackend(myCallback){this.putToBackendRef = myCallback;}\nputToBackend(url, data, callback){return this.putToBackendRef(url, data, callback);}\ndefinePutToUrl(myCallback){this.putToUrlRef = myCallback;}\nputToUrl(url, data, callback){return this.putToUrlRef(url, data, callback);}\ndefineDeleteFromBackend(myCallback){this.deleteFromBackendRef = myCallback;}\ndeleteFromBackend(url, callback){return this.deleteFromBackendRef(url, callback);}\ndefineDeleteFromUrl(myCallback){this.deleteFromUrlRef = myCallback;}\ndeleteFromUrl(url, callback){return this.deleteFromUrlRef(url, callback);}\ndefineSetFormTitle(myCallback){this.setFormTitleRef = myCallback;}\nsetFormTitle(title){return this.setFormTitleRef(title, this.formRef);}\ndefineSetFormDescription(myCallback){this.setFormDescriptionRef = myCallback;}\nsetFormDescription(description){return this.setFormDescriptionRef(description, this.formRef);}\ndefineSetAreaClass(myCallback){this.setAreaClassRef = myCallback;}\nsetAreaClass(code, cssClass){return this.setAreaClassRef(code, cssClass, this.formRef);}\ndefineSetAreaTitle(myCallback){this.setAreaTitleRef = myCallback;}\nsetAreaTitle(code, title){return this.setAreaTitleRef(code, title, this.formRef);}\ndefineSetAreaDescription(myCallback){this.setAreaDescriptionRef = myCallback;}\nsetAreaDescription(code, description){return this.setAreaDescriptionRef(code, description, this.formRef);}\ndefineGetArea(myCallback){this.getAreaRef = myCallback;}\ngetArea(code){return this.getAreaRef(code, this.formRef);}\ndefineNavigator(myCallback){this.navigateRef = myCallback;}\nnavigate(command){return this.navigateRef(command);}\ndefineSetHeaderTabEditable(myCallback){this.setHeaderTabEditableRef = myCallback;}\nsetHeaderTabEditable(code, editable){return this.setHeaderTabEditableRef(code, editable, this.formRef);}\ndefineSetActionButtonEditable(myCallback){this.setActionButtonEditableRef = myCallback;}\nsetActionButtonEditable(code, editable){return this.setActionButtonEditableRef(code, editable, this.formRef);}\ndefineSaveFormData(myCallback){this.saveFormDataRef = myCallback;}\nsaveFormData(callback){return this.saveFormDataRef(callback, this.formRef);}\ndefineSaveAndBackFormData(myCallback){this.saveAndBackFormDataRef = myCallback;}\nsaveAndBackFormData(){return this.saveAndBackFormDataRef(this.formRef);}\ndefineDeleteFormData(myCallback){this.deleteFormDataRef = myCallback;}\ndeleteFormData(){return this.deleteFormDataRef(this.formRef);}\ndefineGetParams(myCallback){this.getParamsRef = myCallback;}\ngetParams(code){return this.getParamsRef(code, this.formRef);}\ndefineSetTableRowActiveById(myCallback){this.setTableRowActiveByIdRef = myCallback;}\nsetTableRowActiveById(code, id){return this.setTableRowActiveByIdRef(code, id, this.formRef);}\ndefineDataset(myDataSet){this.dataSet = myDataSet;}\n\nimport {\r\n  Component,\r\n  Input,\r\n  OnDestroy,\r\n  OnInit\r\n} from \'@angular/core\';\r\nimport { CommonModule } from \'@angular/common\';\r\nimport {Location} from \'@angular/common\';\r\nimport { FormsModule } from \'@angular/forms\';\r\nimport { ActivatedRoute } from \'@angular/router\';\r\nimport { DomSanitizer, Title } from \'@angular/platform-browser\';\r\nimport {EMPTY, Observable, Subject, takeUntil, tap} from \'rxjs\';\r\nimport { CommandNavigatorService } from \'../../../services/system/command-navigator.service\';\r\nimport { LanguageService } from \'../../../services/system/language.service\';\r\nimport { PageComponent } from \'../../page/page-component\';\r\nimport {dateNowPlus, systemParameter, uuid, mergeWithDefaults} from \'../form-utils\';\r\nimport {SofiaFormService} from \'../../../services/crud/sofia-form.service\';\r\n${form.relImports!\'\'}\r\n\r\n/* ============================================================\r\n   Component\r\n   ============================================================ */\r\n@Component({\r\n  selector: \'app-${form.componentName}-form\',\r\n  standalone: true,\r\n  imports: [CommonModule, FormsModule<#if form.relComponents??>, ${form.relComponents}</#if>],\r\n  templateUrl: \'./${form.componentName}-form.component.html\',\r\n  styleUrl: \'./${form.componentName}-form.component.scss\'\r\n})\r\nexport class ${form.componentClass}FormComponent implements OnInit, OnDestroy {\r\n  private readonly destroy$ = new Subject<void>();\r\n  activeTab = \'${form.activeTab}\';\r\n  mode = \'create\';\r\n  @Input() public params: unknown = null;\r\n  data =${form.data};\r\n\r\n<#compress>\r\n<#if form?? && form.tabs??>\r\n  <#list form.tabs?sort_by(\"order\") as tab>\r\n    <#if tab.areas??>\r\n      <#list tab.areas?sort_by(\"order\") as area>\r\n        <#if area.controls??>\r\n          <#list area.controls as control>\r\n\r\n            <#assign isListWithJsonOptions =\r\n            control.kind == \"field\"\r\n            && control.uiType == \"list\"\r\n            && control.options??\r\n            && control.options?has_content\r\n            && control.options?starts_with(\"{\")\r\n                        />\r\n            <#if isListWithJsonOptions>\r\n              <#assign listOptions = control.options?eval_json />\r\n                    ${control.ngModel?replace(\".\", \"_\")}_element = false;\r\n                    ${control.ngModel?replace(\".\", \"_\")}_field_options = ${control.options!\'\'}\r\n            </#if>\r\n\r\n          </#list>\r\n        </#if>\r\n      </#list>\r\n    </#if>\r\n  </#list>\r\n</#if>\r\n</#compress>\r\n\r\n\r\n  constructor(\r\n    private readonly sofiaFormService: SofiaFormService,\r\n    private readonly commandNavigator: CommandNavigatorService,\r\n    private readonly languageService: LanguageService,\r\n    private readonly route: ActivatedRoute,\r\n    private readonly sanitizer: DomSanitizer,\r\n    private readonly location: Location\r\n  ) {}\r\n\r\n  /* =========================\r\n     Lifecycle\r\n     ========================= */\r\n  ngOnInit(): void {\r\n\r\n    if (this.params) {\r\n      this.tryLoadData();\r\n      return;\r\n    }\r\n\r\n    this.route.queryParams\r\n      .pipe(takeUntil(this.destroy$))\r\n      .subscribe(({ nav }) => {\r\n        if (!this.params) {\r\n          this.params = this.commandNavigator.decodeNavCommand(nav);\r\n          this.tryLoadData();\r\n        }\r\n      });\r\n\r\n  }\r\n\r\n  ngOnDestroy(): void {\r\n    this.destroy$.next();\r\n    this.destroy$.complete();\r\n  }\r\n\r\n  selectTab(tab: string): void {\r\n    this.activeTab = tab;\r\n  }\r\n\r\n  private tryLoadData(): void {\r\n    const id = this.getSelectionId();\r\n    if (id) {\r\n      this.mode = \'update\';\r\n      this.loadData(id);\r\n    }\r\n  }\r\n\r\n  private getSelectionId(): string | null {\r\n    return (this.params as any)?.LOCATE?.[\'SELECTION-ID\'] ?? null;\r\n  }\r\n\r\n  loadData(id: string): void {\r\n     this.sofiaFormService\r\n       .getDataById(\'${form.jsonUrl}\', id)\r\n       .subscribe( response => {\r\n         this.data = mergeWithDefaults(\r\n           this.data,\r\n           response\r\n         );\r\n       });\r\n  }\r\n\r\n  saveAndBack(): void {\r\n    const action$ =\r\n      this.mode === \'create\'\r\n        ? this.create()\r\n        : this.mode === \'update\'\r\n          ? this.update()\r\n          : null;\r\n\r\n    if (!action$) {\r\n      return;\r\n    }\r\n\r\n    action$\r\n      .pipe(takeUntil(this.destroy$))\r\n      .subscribe({\r\n        next: () => this.location.back(),\r\n        error: err => console.error(\'Save failed\', err)\r\n      });\r\n  }\r\n\r\n  create(): Observable<any> {\r\n    return this.sofiaFormService.createData(\'${form.jsonUrl}\', this.data).pipe(\r\n      tap(response => {\r\n        this.data = mergeWithDefaults(this.data, response);\r\n        this.mode = \'update\';\r\n      })\r\n    );\r\n  }\r\n\r\n  update(): Observable<any> {\r\n    const id = this.getSelectionId();\r\n    if (!id) {\r\n      return EMPTY;\r\n    }\r\n\r\n    return this.sofiaFormService.updateData(\'${form.jsonUrl}\', id, this.data).pipe(\r\n      tap(response => {\r\n        this.data = mergeWithDefaults(this.data, response);\r\n      })\r\n    );\r\n  }\r\n\r\n  delete(): void {\r\n    const id = this.getSelectionId();\r\n    if (!id) {\r\n      return;\r\n    }\r\n\r\n    this.sofiaFormService\r\n      .deleteData(\'${form.jsonUrl}\', id)\r\n      .pipe(takeUntil(this.destroy$))\r\n      .subscribe({\r\n        error: err => console.error(\'Delete failed\', err)\r\n      });\r\n  }\r\n\r\n  /* =========================\r\n     Utils\r\n     ========================= */\r\n  trustHtml(value?: string) {\r\n    return this.sanitizer.bypassSecurityTrustHtml(value ?? \'\');\r\n  }\r\n\r\n  private get languageId(): string {\r\n    const user = JSON.parse(localStorage.getItem(\'loggedin_user\') ?? \'{}\');\r\n    return user?.currentLanguage?.id ?? 0;\r\n  }\r\n\r\n<#if form?? && form.tabs??>\r\n  <#list form.tabs?sort_by(\"order\") as tab>\r\n    <#if tab.areas??>\r\n      <#list tab.areas?sort_by(\"order\") as area>\r\n        <#if area.controls??>\r\n          <#list area.controls as control>\r\n\r\n            <#assign isListWithJsonOptions =\r\n            control.kind == \"field\"\r\n            && control.uiType == \"list\"\r\n            && control.options??\r\n            && control.options?has_content\r\n            && control.options?starts_with(\"{\")\r\n                        />\r\n            <#if isListWithJsonOptions>\r\n              <#assign listOptions = control.options?eval_json />\r\n\r\n            ${control.ngModel?replace(\".\", \"_\")}_field_return(returingValue: string) {\r\n                this.data.${control.ngModel} = returingValue;\r\n\r\n            <#if listOptions.REFRESH??>\r\n                 this.sofiaFormService\r\n                   .getDataById(\'${form.jsonUrl}/${listOptions.REFRESH}\', returingValue)\r\n                   .subscribe( response => {\r\n                     this.data.${control.cpeRefreshPath!\'\'} = mergeWithDefaults(\r\n                       this.data.${control.cpeRefreshPath!\'\'},\r\n                       response.${listOptions.REFRESH}_obj\r\n                     );\r\n                   });\r\n                </#if>\r\n\r\n            Array.from(document.getElementsByClassName(\'close\'))\r\n              .forEach(el => (el as HTMLElement).click());\r\n            }\r\n\r\n            </#if>\r\n\r\n          </#list>\r\n        </#if>\r\n      </#list>\r\n    </#if>\r\n  </#list>\r\n</#if>\r\n\r\n\r\n\r\n}\r\n\n/* Utility class to hide elements */\r\n.hidden {\r\n  display: none;\r\n}\r\n\r\n/* Custom styled checkbox */\r\n.form-group input[type=checkbox] {\r\n  position: absolute;\r\n  right: 0;\r\n  top: 50%;\r\n  width: 22px;\r\n  height: 22px;\r\n  transform: translateY(-50%);\r\n  border: 2px solid #51cbce;\r\n  border-radius: 6px;\r\n  background: #fff;\r\n  transition: all 120ms ease;\r\n}\r\n\r\n/* Clickable selector input container */\r\n.selector-input {\r\n  display: flex;\r\n  align-items: center;\r\n  width: 100%;\r\n  padding: 8px 12px;\r\n  border: 1px solid #51cbce;\r\n  background-color: #fff;\r\n  box-sizing: border-box;\r\n  cursor: pointer;\r\n}\r\n\r\n/* Optional leading icon */\r\n.selector-icon {\r\n  display: flex;\r\n  align-items: center;\r\n  margin-right: 8px;\r\n  font-size: 16px;\r\n  color: #236594;\r\n  flex-shrink: 0;\r\n}\r\n\r\n/* Input inherits click behavior from container */\r\n.selector-input input {\r\n  flex: 1;\r\n  min-width: 0;\r\n  border: none;\r\n  outline: none;\r\n  background: transparent;\r\n  font-size: 14px;\r\n  cursor: pointer;\r\n}\r\n\r\n.is-default{\r\n    padding-top: 30px;\r\n    padding-left: 20px;\r\n    padding-right: 20px;\r\n}\r\n\r\n.code-area textarea{\r\n    min-height: 800px;\r\n    font-family: \'Fira Code\', \'Consolas\', \'Courier New\', monospace;\r\n    font-size: 14px;\r\n    color: #e0e0e0;\r\n    background-color: #1e1e1e;\r\n    border: 1px solid #3c3c3c;\r\n    border-radius: 6px;\r\n    padding: 12px;\r\n    line-height: 1.5;\r\n    resize: vertical;\r\n    white-space: pre;\r\n    overflow: auto;\r\n    tab-size: 2;\r\n    caret-color: #00ffcc;\r\n}\r\n\r\n.card-header{\r\n  display: none;\r\n}\n<#ftl strip_whitespace=true>\r\n\r\n<div class=\"row form-header\">\r\n    <div class=\"col\" style=\"padding-right: 0px;\">\r\n        <h3 style=\"margin-top: 20px; margin: 0px; margin-top: 10px;\">\r\n            <i style=\"padding-right: 5px;\" class=\"fa ${form.icon!\'\'}\">\r\n            </i>${form.title!\'\'}</h3>\r\n        <p style=\"margin-bottom: 5px;\">\r\n            ${form.description!\'\'}\r\n        </p>\r\n    </div>\r\n    <div class=\"col-auto\" style=\"padding-top: 13px;\">\r\n        <div class=\"pull-right\">\r\n            <#if form?? && form.buttons??>\r\n               <#list form.buttons as button>\r\n                  <button class=\"btn ${button.cssClass!\'\'} ${button.code!\'\'}\"\r\n                      <#if button.code == \"saveAndBack\">(click)=\"saveAndBack()\"</#if>\r\n                      <#if button.code == \"delete\">[disabled]=\"mode === \'create\'\" (click)=\"delete()\"</#if>>\r\n                      <i class=\"fa ${button.icon!\'\'}\"></i>\r\n                      ${button.description!\'\'}\r\n                  </button>\r\n               </#list>\r\n            </#if>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<#-- ========================= -->\r\n<#-- FORM TABS -->\r\n<#-- ========================= -->\r\n<div class=\"form-tabs row\">\r\n    <div class=\"col-sm-12\">\r\n        <div class=\"pull-left\">\r\n\r\n            <#if form?? && form.tabs?? && (form.tabs?size > 1)>\r\n                <#list form.tabs as tab>\r\n                    <button type=\"button\"\r\n                            (click)=\"selectTab(\'${tab.id!\'\'}\')\"\r\n                            class=\"btn btn-outline-default btn-round\r\n                                   <#if tab?index == 0> selected-tab</#if>\"\r\n                            <#if tab.editable?? && !tab.editable>disabled</#if>>\r\n\r\n                        <#if tab.icon?? && tab.icon?has_content>\r\n                            <i class=\"fa ${tab.icon}\"></i>\r\n                        </#if>\r\n\r\n                        <span>${tab.description!\'\'}</span>\r\n                    </button>\r\n                </#list>\r\n            </#if>\r\n\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<#-- ========================= -->\r\n<#-- FORM CONTENT -->\r\n<#-- ========================= -->\r\n<div class=\"row form-tab\">\r\n\r\n<#if form?? && form.tabs??>\r\n<#list form.tabs?sort_by(\"order\") as tab>\r\n\r\n    <#if tab?? && tab.areas??>\r\n    <#list tab.areas?sort_by(\"order\") as area>\r\n\r\n        <div class=\"${area.cssclass!\'\'} form-area form-area-${area.code!\'\'}\" [class.hidden]=\"activeTab !== \'${tab.id!\'\'}\'\">\r\n            <div class=\"card\">\r\n\r\n                <#-- ========================= -->\r\n                <#-- AREA HEADER -->\r\n                <#-- ========================= -->\r\n                <div class=\"card-header\">\r\n                    <div class=\"row formnav\">\r\n                        <div class=\"col-12\">\r\n\r\n                            <div class=\"pull-left\">\r\n                                <h5 class=\"card-title\">\r\n                                    <#if area.icon?? && area.icon?has_content>\r\n                                        <i class=\"fa ${area.icon}\"></i>\r\n                                    </#if>\r\n                                    ${area.title!\'\'}\r\n                                </h5>\r\n\r\n                                <#if area.description?? && area.description?has_content>\r\n                                    <p class=\"card-category\">\r\n                                        ${area.description}\r\n                                    </p>\r\n                                </#if>\r\n                            </div>\r\n\r\n                            <div class=\"pull-right\">\r\n                                <#if area.headerButtons??>\r\n                                <#list area.headerButtons as btn>\r\n                                    <button type=\"button\"\r\n                                            class=\"btn ${btn.cssClass!\'\'}\">\r\n                                        <#if btn.icon?? && btn.icon?has_content>\r\n                                            <i class=\"fa ${btn.icon}\"></i>\r\n                                        </#if>\r\n                                        ${btn.label!\'\'}\r\n                                    </button>\r\n                                </#list>\r\n                                </#if>\r\n                            </div>\r\n\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n\r\n                <#-- ========================= -->\r\n                <#-- AREA BODY -->\r\n                <#-- ========================= -->\r\n                <div class=\"card-body\">\r\n                    <div class=\"row\">\r\n\r\n                        <#-- ========================= -->\r\n                        <#-- FORM CONTROLS -->\r\n                  