control.ngModel} = returingValue;\r\n\r\n            <#if listOptions.REFRESH??>\r\n                 this.sofiaFormService\r\n                   .getDataById(\'${form.jsonUrl}/${listOptions.REFRESH}\', returingValue)\r\n                   .subscribe( response => {\r\n                     this.data.${control.cpeRefreshPath!\'\'} = mergeWithDefaults(\r\n                       this.data.${control.cpeRefreshPath!\'\'},\r\n                       response.${listOptions.REFRESH}_obj\r\n                     );\r\n                   });\r\n                </#if>\r\n\r\n            Array.from(document.getElementsByClassName(\'close\'))\r\n              .forEach(el => (el as HTMLElement).click());\r\n            }\r\n\r\n            </#if>\r\n\r\n          </#list>\r\n        </#if>\r\n      </#list>\r\n    </#if>\r\n  </#list>\r\n</#if>\r\n\r\n\r\n\r\n}\r\n\n/* Utility class to hide elements */\r\n.hidden {\r\n  display: none;\r\n}\r\n\r\n/* Custom styled checkbox */\r\n.form-group input[type=checkbox] {\r\n  position: absolute;\r\n  right: 0;\r\n  top: 50%;\r\n  width: 22px;\r\n  height: 22px;\r\n  transform: translateY(-50%);\r\n  border: 2px solid #51cbce;\r\n  border-radius: 6px;\r\n  background: #fff;\r\n  transition: all 120ms ease;\r\n}\r\n\r\n/* Clickable selector input container */\r\n.selector-input {\r\n  display: flex;\r\n  align-items: center;\r\n  width: 100%;\r\n  padding: 8px 12px;\r\n  border: 1px solid #51cbce;\r\n  background-color: #fff;\r\n  box-sizing: border-box;\r\n  cursor: pointer;\r\n}\r\n\r\n/* Optional leading icon */\r\n.selector-icon {\r\n  display: flex;\r\n  align-items: center;\r\n  margin-right: 8px;\r\n  font-size: 16px;\r\n  color: #236594;\r\n  flex-shrink: 0;\r\n}\r\n\r\n/* Input inherits click behavior from container */\r\n.selector-input input {\r\n  flex: 1;\r\n  min-width: 0;\r\n  border: none;\r\n  outline: none;\r\n  background: transparent;\r\n  font-size: 14px;\r\n  cursor: pointer;\r\n}\r\n\r\n.is-default{\r\n    padding-top: 30px;\r\n    padding-left: 20px;\r\n    padding-right: 20px;\r\n}\r\n\r\n.code-area textarea{\r\n    min-height: 800px;\r\n    font-family: \'Fira Code\', \'Consolas\', \'Courier New\', monospace;\r\n    font-size: 14px;\r\n    color: #e0e0e0;\r\n    background-color: #1e1e1e;\r\n    border: 1px solid #3c3c3c;\r\n    border-radius: 6px;\r\n    padding: 12px;\r\n    line-height: 1.5;\r\n    resize: vertical;\r\n    white-space: pre;\r\n    overflow: auto;\r\n    tab-size: 2;\r\n    caret-color: #00ffcc;\r\n}\r\n\r\n.card-header{\r\n  display: none;\r\n}\n<#ftl strip_whitespace=true>\r\n\r\n<div class=\"row form-header\">\r\n    <div class=\"col\" style=\"padding-right: 0px;\">\r\n        <h3 style=\"margin-top: 20px; margin: 0px; margin-top: 10px;\">\r\n            <i style=\"padding-right: 5px;\" class=\"fa ${form.icon!\'\'}\">\r\n            </i>${form.title!\'\'}</h3>\r\n        <p style=\"margin-bottom: 5px;\">\r\n            ${form.description!\'\'}\r\n        </p>\r\n    </div>\r\n    <div class=\"col-auto\" style=\"padding-top: 13px;\">\r\n        <div class=\"pull-right\">\r\n            <#if form?? && form.buttons??>\r\n               <#list form.buttons as button>\r\n                  <button class=\"btn ${button.cssClass!\'\'} ${button.code!\'\'}\"\r\n                      <#if button.code == \"saveAndBack\">(click)=\"saveAndBack()\"</#if>\r\n                      <#if button.code == \"delete\">[disabled]=\"mode === \'create\'\" (click)=\"delete()\"</#if>>\r\n                      <i class=\"fa ${button.icon!\'\'}\"></i>\r\n                      ${button.description!\'\'}\r\n                  </button>\r\n               </#list>\r\n            </#if>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<#-- ========================= -->\r\n<#-- FORM TABS -->\r\n<#-- ========================= -->\r\n<div class=\"form-tabs row\">\r\n    <div class=\"col-sm-12\">\r\n        <div class=\"pull-left\">\r\n\r\n            <#if form?? && form.tabs?? && (form.tabs?size > 1)>\r\n                <#list form.tabs as tab>\r\n                    <button type=\"button\"\r\n                            (click)=\"selectTab(\'${tab.id!\'\'}\')\"\r\n                            class=\"btn btn-outline-default btn-round\r\n                                   <#if tab?index == 0> selected-tab</#if>\"\r\n                            <#if tab.editable?? && !tab.editable>disabled</#if>>\r\n\r\n                        <#if tab.icon?? && tab.icon?has_content>\r\n                            <i class=\"fa ${tab.icon}\"></i>\r\n                        </#if>\r\n\r\n                        <span>${tab.description!\'\'}</span>\r\n                    </button>\r\n                </#list>\r\n            </#if>\r\n\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n<#-- ========================= -->\r\n<#-- FORM CONTENT -->\r\n<#-- ========================= -->\r\n<div class=\"row form-tab\">\r\n\r\n<#if form?? && form.tabs??>\r\n<#list form.tabs?sort_by(\"order\") as tab>\r\n\r\n    <#if tab?? && tab.areas??>\r\n    <#list tab.areas?sort_by(\"order\") as area>\r\n\r\n        <div class=\"${area.cssclass!\'\'} form-area form-area-${area.code!\'\'}\" [class.hidden]=\"activeTab !== \'${tab.id!\'\'}\'\">\r\n            <div class=\"card\">\r\n\r\n                <#-- ========================= -->\r\n                <#-- AREA HEADER -->\r\n                <#-- ========================= -->\r\n                <div class=\"card-header\">\r\n                    <div class=\"row formnav\">\r\n                        <div class=\"col-12\">\r\n\r\n                            <div class=\"pull-left\">\r\n                                <h5 class=\"card-title\">\r\n                                    <#if area.icon?? && area.icon?has_content>\r\n                                        <i class=\"fa ${area.icon}\"></i>\r\n                                    </#if>\r\n                                    ${area.title!\'\'}\r\n                                </h5>\r\n\r\n                                <#if area.description?? && area.description?has_content>\r\n                                    <p class=\"card-category\">\r\n                                        ${area.description}\r\n                                    </p>\r\n                                </#if>\r\n                            </div>\r\n\r\n                            <div class=\"pull-right\">\r\n                                <#if area.headerButtons??>\r\n                                <#list area.headerButtons as btn>\r\n                                    <button type=\"button\"\r\n                                            class=\"btn ${btn.cssClass!\'\'}\">\r\n                                        <#if btn.icon?? && btn.icon?has_content>\r\n                                            <i class=\"fa ${btn.icon}\"></i>\r\n                                        </#if>\r\n                                        ${btn.label!\'\'}\r\n                                    </button>\r\n                                </#list>\r\n                                </#if>\r\n                            </div>\r\n\r\n                        </div>\r\n                    </div>\r\n                </div>\r\n\r\n                <#-- ========================= -->\r\n                <#-- AREA BODY -->\r\n                <#-- ========================= -->\r\n                <div class=\"card-body\">\r\n                    <div class=\"row\">\r\n\r\n                        <#-- ========================= -->\r\n                        <#-- FORM CONTROLS -->\r\n                        <#-- ========================= -->\r\n                        <#if area.controls??>\r\n                        <#list area.controls as control>\r\n\r\n                            <#if control?? && (control.visible?? && control.visible)>\r\n\r\n                                <#-- ========================= -->\r\n                                <#-- FIELD CONTROLS -->\r\n                                <#-- ========================= -->\r\n                                <#if control.kind == \"field\">\r\n\r\n                                    <div class=\"form-field ${control.cssClass!\'\'}\">\r\n                                        <div class=\"form-group\">\r\n\r\n                                            <#if control.label?? && control.label?has_content>\r\n                                                <label>${control.label}</label>\r\n                                            </#if>\r\n\r\n                                            <#-- HTML -->\r\n                                            <#if control.uiType == \"html\">\r\n                                                <div [innerHTML]=\"trustHtml(data.${control.ngModel})\"></div>\r\n                                            </#if>\r\n\r\n                                            <#-- TEXT -->\r\n                                            <#if control.uiType == \"text\">\r\n                                                <input type=\"text\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- TEXTAREA -->\r\n                                            <#if control.uiType == \"textarea\">\r\n                                                <textarea class=\"form-control\"\r\n                                                          <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                          <#if !control.editable>readonly</#if>>\r\n                                                    ${control.value!\'\'}\r\n                                                </textarea>\r\n                                            </#if>\r\n\r\n                                            <#-- INTEGER -->\r\n                                            <#if control.uiType == \"int\">\r\n                                                <input type=\"number\"\r\n                                                       step=\"1\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- DECIMAL -->\r\n                                            <#if control.uiType == \"decimal\">\r\n                                                <input type=\"number\"\r\n                                                       step=\"any\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- DATE -->\r\n                                            <#if control.uiType == \"date\">\r\n                                                <input type=\"date\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- DATETIME -->\r\n                                            <#if control.uiType == \"datetime\">\r\n                                                <input type=\"datetime-local\"\r\n                                                       class=\"form-control\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if !control.editable>readonly</#if>\r\n                                                       value=\"${control.value!\'\'}\" />\r\n                                            </#if>\r\n\r\n                                            <#-- CHECKBOX -->\r\n                                            <#if control.uiType == \"checkbox\">\r\n                                                <input type=\"checkbox\"\r\n                                                       <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                       <#if control.value?? && control.value == true>checked</#if>\r\n                                                       <#if !control.editable>disabled</#if> />\r\n                                            </#if>\r\n\r\n                                            <#-- SELECT -->\r\n                                            <#if control.uiType == \"select\">\r\n\r\n                                                <#-- parse JSON string  object -->\r\n                                                <#assign options = control.options?eval_json>\r\n\r\n                                                <select class=\"form-control\"\r\n                                                <#if control.ngModel??> [(ngModel)]=\"data.${control.ngModel}\"</#if>\r\n                                                <#if !control.editable>disabled</#if>>\r\n\r\n                                                <#if options?? && options.data??>\r\n                                                    <#list options.data as opt>\r\n                                                    <option value=\"${opt.value!\'\'}\">\r\n                                                        ${opt.display!\'\'}\r\n                                                    </option>\r\n                                                    </#list>\r\n                                                </#if>\r\n\r\n                                                </select>\r\n                                            </#if>\r\n\r\n\r\n                                            <#-- LIST -->\r\n                                            <#if\r\n                                            control.uiType == \"list\" &&\r\n                                            control.options?? &&\r\n                                            control.options?has_content &&\r\n                                            control.options?starts_with(\"{\")>\r\n                                            <#assign listOptions = control.options?eval_json>\r\n                                            <div class=\"selector-input\"\r\n                                                 (click)=\"${control.ngModel?replace(\".\", \"_\")}_element = true\"\r\n                                            <#if listOptions.NAME??>data-target=\"#${listOptions.NAME!\'\'}Modal\" data-toggle=\"modal\"</#if>\r\n                                            >\r\n                                                <i class=\"fa-solid fa-magnifying-glass selector-icon\"></i>\r\n                                                <input\r\n                                                        type=\"text\"\r\n                                                        <#if listOptions.NAME??>value=\"${listOptions.DISPLAY!\'\'}\"</#if>\r\n                                                        readonly\r\n                                                />\r\n                                            </div>\r\n                                            </#if>\r\n                                            <#if control.message?? && control.message?has_content>\r\n                                            <div class=\"category\">${control.message}</div>\r\n                                            </#if>\r\n\r\n                                        </div>\r\n                                    </div>\r\n\r\n                                </#if>\r\n\r\n                                <#-- ========================= -->\r\n                                <#-- BUTTON CONTROL -->\r\n                                <#-- ========================= -->\r\n                                <#if control.kind == \"button\">\r\n                                    <div class=\"form-field ${control.cssClass!\'\'}\">\r\n                                        <button type=\"button\"\r\n                                                class=\"btn ${control.buttonClass!\'\'}\">\r\n                                            <i class=\"fa ${control.icon!\'\'}\"></i>\r\n                                            ${control.label!\'\'}\r\n                                        </button>\r\n                                    </div>\r\n                                </#if>\r\n\r\n                                <#-- ========================= -->\r\n                                <#-- TABLE CONTROL (INTENTIONALLY EMPTY) -->\r\n                                <#-- ========================= -->\r\n                                <#if control.kind == \"table\">\r\n                                    <#-- table rendering will be implemented in future version -->\r\n                                </#if>\r\n\r\n                            </#if>\r\n\r\n                        </#list>\r\n                        </#if>\r\n\r\n                    </div>\r\n                </div>\r\n\r\n            </div>\r\n        </div>\r\n\r\n    </#list>\r\n    </#if>\r\n\r\n</#list>\r\n</#if>\r\n\r\n</div>\r\n\r\n<#if form?? && form.tabs??>\r\n<#list form.tabs?sort_by(\"order\") as tab>\r\n\r\n    <#if tab?? && tab.areas??>\r\n    <#list tab.areas?sort_by(\"order\") as area>\r\n\r\n        <#if area.controls??>\r\n        <#list area.controls as control>\r\n\r\n            <#assign isListWithJsonOptions =\r\n            control.kind == \"field\"\r\n            && control.uiType == \"list\"\r\n            && control.options??\r\n            && control.options?has_content\r\n            && control.options?starts_with(\"{\")\r\n            >\r\n\r\n            <#if isListWithJsonOptions>\r\n            <#assign listOptions = control.options?eval_json>\r\n\r\n                <#if listOptions.NAME??>\r\n                    <div aria-labelledby=\"ModalLabel\" class=\"modal fade\" id=\"${listOptions.NAME!\'\'}Modal\" role=\"dialog\" aria-hidden=\"true\" style=\"margin: 10px;\">\r\n                        <div class=\"modal-dialog modal-dialog-centered\" style=\"max-width: 100%;margin: 0px;\">\r\n                            <div class=\"modal-content\" style=\"background-color: #ffffffad !important;\">\r\n                                <div class=\"modal-header justify-content-center\" style=\"display: block !important;padding: 10px;\">\r\n                                    <button aria-label=\"Close\" data-dismiss=\"modal\" id=\"buttonClose\" type=\"button\" class=\"close modal-dialog-button\">\r\n                                        <i class=\"fa fa-times\"></i>\r\n                                    </button>\r\n                                    <span class=\"modal-title\">\r\n                              ${listOptions.POPUPTITLE!\'\'}\r\n                              <b>Navigate</b> to Entities &amp; press <i class=\"fa fa-square-plus\"></i> to select.</span>\r\n                                </div>\r\n                                <div class=\"modal-body modal-dialog-body\">\r\n                                    <ng-template [ngIf]=\"${control.ngModel?replace(\".\", \"_\")}_element\">\r\n                                        <app-${listOptions.NAME!\'\'} (returnEmmiter)=\"${control.ngModel?replace(\".\", \"_\")}_field_return($event)\" [params]=\"${control.ngModel?replace(\".\", \"_\")}_field_options\"></app-${listOptions.NAME!\'\'}>\r\n                                    </ng-template>\r\n                                </div>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n                </#if>\r\n\r\n            </#if>\r\n\r\n        </#list>\r\n        </#if>\r\n\r\n    </#list>\r\n    </#if>\r\n\r\n</#list>\r\n</#if>\n\nnativeButtonClickHandler(btnCode) {\n}\n\nnativeTableButtonClickHandler(btnCode, formControlTable, dataLine) {\n}\n\nnativeFormEventsHandler(type, metadata) {\nif((type == \'onFormOpen\') && (typeof this.onFormOpen == \"function\")) this.onFormOpen(metadata);\n}\n\nnativeFieldEventsHandler(entityCode, fieldName, type, event) {\n}\n\nnativeTableFieldEventsHandler(entityCode, fieldName, type, event, formControlTable, dataLine) {\n}\n}', 'Graph Template', '4116843e-156c-4f39-ae46-791df6ebfae7', NULL, b'1', b'1');

